import React from "react";
import "./dogCard.css";

const DogCard = ({ name, image, temperament, weight, id }) => {
  return (
    <div className="card-container">
      <img src={image} alt={name} />
      <h2>{name}</h2>
      <h4>{temperament}</h4>
      <h4>Weight: {weight} kg</h4>
      <a href={`/dogs/${id}`}>See more details</a>
    </div>
  );
};

export default DogCard;
